import MainNavigation from "../components/MainNavigation";
import PageContent from "./PageContent";

const ErrorPage = () => {
  const error = useRouteError();
  error.status
  return (
    <>
    <MainNavigation />
    <PageContent title='An error occurred'/>
    <p>Something went wrong</p>
    <Link to='/'>HOME</Link>
    </>
  )
}

export default ErrorPage
